//转换成 svg 的属性
function getSvgProps(props){
    const svgProps = {
        height: (props.size || 16),
        width: (props.size || 16),
        fill: (props.color || "#666"),
        onPress: props.onPress,
        viewBox: "0 0 1024 1024",
        style: props.style
    }
    
    if(props.offset){
        if(!svgProps.style){
            svgProps.style = {}
        }
        
        if(props.offset > 0){
            svgProps.style.marginLeft = props.offset
        } else {
            svgProps.style.marginRight = -props.offset
        }
    }
    
    return svgProps
}

